db.comments.aggregate([
  {
    $match: {
      date: { $gte: new Date(new Date().setDate(new Date().getDate() - 30)) }
    }
  },
  {
    $group: {
      _id: "$movie_id",
      commentCount: { $sum: 1 }
    }
  },
  {
    $lookup: {
      from: "movies",
      localField: "_id",
      foreignField: "_id",
      as: "movieDetails"
    }
  },
  {
    $unwind: "$movieDetails"
  },
  {
    $sort: { commentCount: -1 }
  },
  {
    $project: {
      _id: 0,
      title: "$movieDetails.title",
      commentCount: 1,
      plot: "$movieDetails.plot",
      released: "$movieDetails.released"
    }
  },
  {
    $limit: 10
  }
]);

